script: |
  super -f text -I q9750.spq | sort > q9750.out

inputs:
  - name: q9750.spq
    data: |
      SELECT ALL - 90 AS col2, - 4 - - - 22 - col1 / - + col2 * 73 FROM tab1 (FORMAT parquet) AS cor0;
  - name: tab1

outputs:
  - name: q9750.out
    data: |
      -90	-26
      -90	-26
      -90	-26
